import React from 'react';
import API from './Api';
import Container from '@material-ui/core/Container';
import {
  fade,
  ThemeProvider,
  withStyles,
  makeStyles,
  createMuiTheme,
} from '@material-ui/core/styles';
import InputBase from '@material-ui/core/InputBase';
import InputLabel from '@material-ui/core/InputLabel';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';

import { deepOrange } from '@material-ui/core/colors';

const CssTextField = withStyles({
  root: {
    '& label.Mui-focused': {
      color: 'deepOrange',
    },
    '& .MuiInput-underline:after': {
      borderBottomColor: 'deepOrange',
    },
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: 'red',
      },
      '&:hover fieldset': {
        borderColor: 'yellow',
      },
      '&.Mui-focused fieldset': {
        borderColor: 'deepOrange',
      },
    },
  },
})(TextField);


class BienesApi extends React.Component {
    
    

    async componentDidMount() {
        
        var headers = {
            "Access-Control-Allow-Origin":"*",
            "Access-Control-Allow-Methods":"GET, POST, PATCH, PUT, DELETE, OPTIONS",
            "Access-Control-Allow-Headers":"Origin, Content-Type, X-Auth-Token"
            }
        // Load async data.
            /*getRef.do?json={"id":"funRegistroGarantias"}*/
            //const response = await API.get('https://jsonplaceholder.typicode.com/todos/1');
        const response = API.get('getRef.do?json={"id":"funRegistroGarantias"}',{headers}).then(function (result){
            console.log('ðŸ‘‰ Returned data:', response);
        }).catch (function (error){
            console.log(`ðŸ˜± Axios request failed: ${error}`);
        });
    }
    render() {

        return (
            <div>
                <Container maxWidth="sm" style={{margin: "20px"}}>
                    <TextField required id="outlined-secondary" label="Required" defaultValue="Hello World" color="deepOrange"/>
                </Container>
            </div>
        );
    }
}
export default BienesApi;
